,"languageName":{"simpleText":"Xhosa"}},{"languageCode":"yo","languageName":{"simpleText":"Yoruba"}},{"languageCode":"zu","languageName":{"simpleText":"Zulu"}}],"defaultAudioTrackIndex":0}},"videoDetails":{"videoId":"Uqt4Sls_yTI","title":"Who Is Devin Nunes? Narrated by Gina Brillon | NowThis","lengthSeconds":"498","keywords":["NowThis","NowThisNews","Now This News","NowThis News","Now This Media","NowThis Media","Current Events","news","US news","current events today","Devin Nunes","Who Is","Who is Devin Nunes","Gina Brillon","Rep Devin Nunes","Rep. Devin Nunes","cow parody Twitter account","impeachment","Portuguese immigrant","Portuguese","farmers","Republican","Originals","Politics","Ukrainians","Biden","dairy farm","Devin Gerald Nunes","immigration","amnesty","undocumented","California","illegal immigration","Steve King","immigrant labor"],"channelId":"UCn4sPeUomNGIr26bElVdDYg","isOwnerViewing":false,"shortDescription":"Rep. Devin Nunes went from suing a cow parody Twitter account to being center stage in the impeachment process. Here’s how the child of Portuguese immigrant farmers became a Republican heavy.\n» Subscribe to NowThis: http://go.nowth.is/News_Subscribe\n» Sign up for our newsletter KnowThis to get the biggest stories of the day delivered straight to your inbox: https://go.nowth.is/KnowThis\n\nIn US news and current events today, long before Devin Nunes was allegedly taking trips to Europe and milking Ukrainians for dirt on the Bidens, he was probably milking cows on his family’s dairy farm.\n\nThis is the story of Devin Nunes a congressman who went from suing a cow parody Twitter account to being center stage in one former steak salesman's impeachment process.\n\nDevin Gerald Nunes was born in 1973 in Tulare, California. His family is of Portugese descent, they emigrated from Azores to the U.S., which is possibly why Nunes once had a lax view on immigration. Nunes once supported moderate immigration reform such as giving amnesty to undocumented people living and working in the U.S.. \n\nBut as Trump has increased resources for Immigration and Customs Enforcement and instituted a family separation policy at the border, Nunes has stood by the recipient of Home Alone 2 residual checks.\n\nBefore Nunes backed Trump’s every move, he was working on his family’s 640-acre dairy farm, looking like this. Nunes grew up on the California dairy farm, seemingly milking cows and raising cattle. But along the way, he also raised some eyebrows.\n\nA deeply sourced Esquire report notes that the farm secretly moved to Sibley, Iowa more than a decade ago. Nunes hasn’t acknowledged the move and the piece alleges that the farm heavily relies on cheap undocumented immigrant labor.\n\n It’s worth noting that in 2010, Nunes campaigned for racist Iowa Congressman Steve King, who called illegal immigration a “slow-motion terrorist attack”. Nunes might want to stop campaigning for guys that want to rid the country of the very people his family’s farm ostensibly relies on to stay afloat. Nunes has since sued Ryan Lizza, the author of the Esquire piece, and the publisher, for $75 million in damages.\n\n#WhoIs #DevinNunes #Republican #News #NowThis #NowThisNews\n\nConnect with NowThis\n» Like us on Facebook: http://go.nowth.is/News_Facebook\n» Tweet us on Twitter: http://go.nowth.is/News_Twitter\n» Follow us on Instagram: http://go.nowth.is/News_Instagram\n» Find us on Snapchat Discover: http://go.nowth.is/News_Snapchat\n\nNowThis is your premier news outlet providing you with all the videos you need to stay up to date on all the latest in trending news. From entertainment to politics, to viral videos and breaking news stories, we’re delivering all you need to know straight to your social feeds. We live where you live.\n\nhttp://www.youtube.com/nowthisnews\n@nowthisnews","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/Uqt4Sls_yTI/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs fore Devin Nunes was allegedly taking trips to Europe and milking Ukrainians for dirt on the Bidens, he was probably milking cows on his family’s dairy farm.\n\nThis is the story of Devin Nunes a congressman who went from suing a cow parody Twitter account to being center stage in one former steak salesman's impeachment process.\n\nDevin Gerald Nunes was born in 1973 in Tulare, California. His family is of Portugese descent, they emigrated from Azores to the U.S., which is possibly why Nunes once had a lax view on immigration. Nunes once supported moderate immigration reform such as giving amnesty to undocumented people living and working in the U.S.. \n\nBut as Trump has increased resources for Immigration and Customs Enforcement and instituted a family separation policy at the border, Nunes has stood by the recipient of Home Alone 2 residual checks.\n\nBefore Nunes backed Trump’s every move, he was working on his family’s 640-acre dairy farm, looking like this. Nunes grew up on the California dairy farm, seemingly milking cows and raising cattle. But along the way, he also raised some eyebrows.\n\nA deeply sourced Esquire report notes that the farm secretly moved to Sibley, Iowa more than a decade ago. Nunes hasn’t acknowledged the move and the piece alleges that the farm heavily relies on cheap undocumented immigrant labor.\n\n It’s worth noting that in 2010, Nunes campaigned for racist Iowa Congressman Steve King, who called illegal immigration a “slow-motion terrorist attack”. Nunes might want to stop campaigning for guys that want to rid the country of the very people his family’s farm ostensibly relies on to stay afloat. Nunes has since sued Ryan Lizza, the author of the Esquire piece, and the publisher, for $75 million in damages.\n\n#WhoIs #DevinNunes #Republican #News #NowThis #NowThisNews\n\nConnect with NowThis\n» Like us on Facebook: http://go.nowth.is/News_Facebook\n» Tweet us on Twitter: http://go.nowth.is/News_Twitter\n» Follow us on Instagram: http: e,"descriptionCollapsedLines":3,"showMoreCommand":{"clickTrackingParams":"COMBEM2rARgBIhMInoLczfO1jQMVQWt6BR21tggg","commandExecutorCommand":{"commands":[{"clickTrackingParams":"COMBEM2rARgBIhMInoLczfO1jQMVQWt6BR21tggg","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_EXPANDED"}},{"clickTrackingParams":"COMBEM2rARgBIhMInoLczfO1jQMVQWt6BR21tggg","scrollToEngagementPanelCommand":{"targetId":"engagement-panel-structured-description"}}]}},"showLessCommand":{"clickTrackingParams":"COMBEM2rARgBIhMInoLczfO1jQMVQWt6BR21tggg","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"Rep. Devin Nunes went from suing a cow parody Twitter account to being center stage in the impeachment process. Here’s how the child of Portuguese immigrant farmers became a Republican heavy.\n» Subscribe to NowThis: http://go.nowth.is/News_Subscribe\n» Sign up for our newsletter KnowThis to get the biggest stories of the day delivered straight to your inbox: https://go.nowth.is/KnowThis\n\nIn US news and current events today, long before Devin Nunes was allegedly taking trips to Europe and milking Ukrainians for dirt on the Bidens, he was probably milking cows on his family’s dairy farm.\n\nThis is the story of Devin Nunes a congressman who went from suing a cow parody Twitter account to being center stage in one former steak salesman's impeachment process.\n\nDevin Gerald Nunes was born in 1973 in Tulare, California. His family is of Portugese descent, they emigrated from Azores to the U.S., which is possibly why Nunes once had a lax view on immigration. Nunes once supported moderate immigration reform such as giving amnesty to undocumented people living and working in the U.S.. \n\nBut as Trump has increased resources for Immigration and Customs Enforcement and instituted a family separation policy at the border, Nunes has stood by the recipient of Home Alone 2 residual checks.\n\nBefore Nunes backed Trump’s every move, he was working on his family’s 640-acre dairy farm, looking like this. Nunes grew up on the California dairy farm, seemingly milking cows and raising cattle. But along the way, he also raised some eyebrows.\n\nA deeply sourced Esquire report notes that the farm secretly moved to Sibley, Iowa more than a decade ago. Nunes hasn’t acknowledged the move and the piece alleges that the farm heavily relies on cheap undocumented immigrant labor.\n\n It’s worth noting that in 2010, Nunes campaigned for racist Iowa Congressman Steve King, who called illegal immigration a “slow-motion terrorist attack”. Nunes might want to stop campaigning for guys that want to rid the country of the very people his family’s farm ostensibly relies on to stay afloat. Nunes has since sued Ryan Lizza, the author of the Esquire piece, and the publisher, for $75 million in damages.\n\n#WhoIs #DevinNunes #Republican #News #NowThis #NowThisNews\n\nConnect with NowThis\n» Like us on Facebook: http://go.nowth.is/News_Facebook\n» Tweet us on Twitter: http://go.nowth.is/News_Twitter\n» Follow us on Instagram: http://go.nowth.is/News_Instagram\n» Find us on Snapchat Discover: http://go.nowth.is/News_Snapchat\n\nNowThis is your premier news outlet providing you with all the videos you need to stay up to date on all the latest in trending news. From entertainment to politics, to viral videos and breaking news stories, we’re delivering all you need to know straight to your social feeds. We live where you live.\n\n   / nowthisnews  \n@nowthisnews","commandRuns":[{"startIndex":216,"length":33,"onTap":{"innertubeCommand":{"clickTrackingParams":"COMBEM2rARgBIhMInoLczfO1jQMVQWt6BR21tgggSLKS_9mlid7VUg==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqa0hNeHlSNkhLUEZCRFZHbkpHNFJVSG51TWN4UXxBQ3Jtc0ts taking trips to Europe and milking Ukrainians for dirt on the Bidens, he was probably milking cows on his family’s dairy farm.\n\nThis is the story of Devin Nunes a congressman who went from suing a cow parody Twitter account to being center stage in one former steak salesman's impeachment process.\n\nDevin Gerald Nunes was born in 1973 in Tulare, California. His family is of Portugese descent, they emigrated from Azores to the U.S., which is possibly why Nunes once had a lax view on immigration. Nunes once supported moderate immigration reform such as giving amnesty to undocumented people living and working in the U.S.. \n\nBut as Trump has increased resources for Immigration and Customs Enforcement and instituted a family separation policy at the border, Nunes has stood by the recipient of Home Alone 2 residual checks.\n\nBefore Nunes backed Trump’s every move, he was working on his family’s 640-acre dairy farm, looking like this. Nunes grew up on the California dairy farm, seemingly milking cows and raising cattle. But along the way, he also raised some eyebrows.\n\nA deeply sourced Esquire report notes that the farm secretly moved to Sibley, Iowa more than a decade ago. Nunes hasn’t acknowledged the move and the piece alleges that the farm heavily relies on cheap undocumented immigrant labor.\n\n It’s worth noting that in 2010, Nunes campaigned for racist Iowa Congressman Steve King, who called illegal immigration a “slow-motion terrorist attack”. Nunes might want to stop campaigning for guys that want to rid the country of the very people his family’s farm ostensibly relies on to stay afloat. Nunes has since sued Ryan Lizza, the author of the Esquire piece, and the publisher, for $75 million in damages.\n\n#WhoIs #DevinNunes #Republican #News #NowThis #NowThisNews\n\nConnect with NowThis\n» Like us on Facebook: http://go.nowth.is/News_Facebook\n» Tweet us on Twitter: http://go.nowth.is/News_Twitter\n» Follow us on Instagram: http://go.nowth.is/News_Instagram\n»
